ate sa artworks nila, right? Daily Activities doesn't mean that we're competing. If you'll look on it's main purpose, it will really help you. Aim to have that certificates! Wag malungkot kung hindi ka nananalo, instead, use that as a motivation para mas galingan pa. Do your best everyday, !!\\n\\n; Don't be shy to seek for advices. Kung gusto niyong matuto ng styles or anything mula sa artworks ng iba, don't hesitate to ask. Let's all help each other, share your knowledge because you'll also learn something from them.\\n\\n; Practice. Practice. Practice. We're all familiar to the famous saying na \\\"Practice makes perfect\\\", right? It's a process, and process won't come overnight. Wag mong tignan ang improvement ng iba kasi mas matagal kang makakarating sa gusto mo. Focus on your paper. Don't lose hope, gagaling ka rin.\\n\\nPadayon, Calligraphers!\\ud83d\\udc97\\n\\n-ADMINS\",[19,\"280549\"],\"https:\\\/\\\/scontent.fcrk2-1.fna.fbcdn.net\\\/v\\\/t39.30808-6\\\/364145795_1758186024639085_3152038303280758693_n.jpg?stp=c0.62.771.771a_dst-jpg_s100x100_tt6&_nc_cat=102&ccb=1-7&_nc_sid=1760b9&_nc_eui2=AeG_tNm23daXlPh-7p-4GOUxU-z5ZrExxR5T7PlmsTHFHmFqszuspBAkPV2b_z68JunBjTFur6nd4PScagYgVgLG&_nc_ohc=yFb6LOEJ8eQQ7kNvwHut2Be&_nc_oc=AdlJTM7nJPsVmgA2f9zCWn2WTSsoQb9e9ISZmfKldIJkwOKc-hlp0hIBdPL-lfQ2qQ8&_nc_zt=23&_nc_ht=scontent.fcrk2-1.fna&_nc_gid=_Dh3UpZqKWG7Bq93nBBzWg&oh=00_AfLYvo_8Yb9HcaakwxMpKqkbbq_7uTmWQkXvjgnm--hdRA&oe=68228B10\",\"\\\/messaging\\\/lightspeed\\\/media_fallback\\\/?entity_id=1993020620887596&entity_type=36&width=100&height=100\",[19,\"1747094288\"],[19,\"1633526823000\"],[19,\"1746706342350\"],\"\",[19,\"-8418669126655924200\"],[19,\"59190020224\"],[19,\"0\"],[19,\"3\"],[19,\"0\"],[19,\"0\"],false,false,\"https:\\\/\\\/m.me\\\/cm\\\/AbYpNN9WHgBaGFhY\\\/\",[19,\"0\"],\"https:\\\/\\\/m.me\\\/cm\\\/AbYpNN9WHgBaGFhY\\\/\",[19,\"1\"],[9],[19,\"2\"],[9],[19,\"1\"],[9],[19,\"0\"],[19,\"0\"],[9],\"https:\\\/\\\/scontent.fcrk2-1.fna.fbcdn.net\\\/v\\\/t39.30808-6\\ content.fcrk2-2.fna&_nc_gid=_Dh3UpZqKWG7Bq93nBBzWg&oh=00_AfJYanwbv6O663Yqo_Ioyia-1tljvrJwPWrMOw79BpwbPA&oe=68227F71\",\"\\\/messaging\\\/lightspeed\\\/media_fallback\\\/?entity_id=994080001781716&entity_type=36&width=100&height=100\",[19,\"1747091313\"],[9],[9],[19,\"2\"],[19,\"1746711458655\"],[19,\"1\"],true,[9],[9],[9]]],[1,[5,\"populateCommunityFolderData\",[19,\"207084398841796\"],[19,\"533679533976549\"],\"Jen's Closet ( Gowns for Rent )\",\"Welcome to \\ud835\\udddd\\ud835\\uddd8\\ud835\\udde1\\u275c\\ud835\\udde6 \\ud835\\uddd6\\ud835\\udddf\\ud835\\udde2\\ud835\\udde6\\ud835\\uddd8\\ud835\\udde7 \\ud83c\\udf42 \\nPlease read these \\ud835\\ude4d\\ud835\\ude5a\\ud835\\ude63\\ud835\\ude69\\ud835\\ude56\\ud835\\ude61 \\ud835\\ude4f\\ud835\\ude5a\\ud835\\ude67\\ud835\\ude62\\ud835\\ude68 \\ud835\\ude56\\ud835\\ude63\\ud835\\ude59 \\ud835\\ude3e\\ud835\\ude64\\ud835\\ude63\\ud835\\ude59\\ud835\\ude5e\\ud835\\ude69\\ud835\\ude5e\\ud835\\ude64\\ud835\\ude63\\ud835\\ude68 (\\u201cTerms\\u201d or \\u201cAgreement\\u201d) \\n\\n\\ud835\\uddd9\\ud835\\udddc\\ud835\\udde7\\ud835\\udde7\\ud835\\udddc\\ud835\\udde1\\ud835\\uddda \\nOpen for \\ud835\\ude52\\ud835\\ude56\\ud835\\ude61\\ud835\\ude60-\\ud835\\ude5e\\ud835\\ude63\\ud835\\ude68 and \\ud835\\ude3c\\ud835\\ude65\\ud835\\ude65\\ud835\\ude64\\ud835\\ude5e\\ud835\\ude63\\ud835\\ude69\\ud835\\ude62\\ud835\\ude5a\\ud835\\ude63\\ud835\\ude69\\ud835\\ude68 everyday from 10am to 8pm.\\n\\n\\ud83d\\udccdMandaluyong Public Market II \\n F. Martinez Avenue \\nThird Floor Store 3E-2\\n+639858524283\\n\\n\\ud83d\\uddfa Google Map - https:\\\/\\\/g.co\\\/kgs\\\/rD8Cmz\\n\\n\\ud835\\udde5\\ud835\\uddf2\\ud835\\ude00\\ud835\\uddf2\\ud835\\uddff\\ud835\\ude03\\ud835\\uddee\\ud835\\ude01\\ud835\\uddf6\\ud835\\uddfc\\ud835\\uddfb \\ud835\\uddd9\\ud835\\uddf2\\ud835\\uddf2\\nAfter choosing your preferred gown, you will be required to provide non-refundable P300 down payment in order to reserve gown.\\n\\n\\ud835\\ude4b\\ud835\\ude6
